import "../assets/scss/Gallery.scss";
import FadeInSection from "./FadeInSection";

function Gallery() {
    return (
        <div className="gallery">
            <FadeInSection>
                <h2 className="next-step">Gallery</h2>
            </FadeInSection>
        </div>
    );
}

export default Gallery;
